import './App.css';
import React, { useState } from 'react';


function App() {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleEmailChange = (event) => {
      setEmail(event.target.value);
    };

    const handlePasswordChange = (event) => {
      setPassword(event.target.value);
    };

    const checkCredentials = () => {
      if (email === "123" && password === "123") {
        // Przekieruj użytkownika na inną stronę po zalogowaniu
        window.location.href = "/WebApplication/screenAfterLogin.html";
      } else {
        alert("Nieprawidłowy email lub hasło. Spróbuj ponownie.");
      }
    };

  return (
    <div className="App">
      <head>
        <link rel="stylesheet" href="css/loginScreen_styles.css"></link>
    <title>TeeplanLogin</title>
</head>
<body>
    <div id="middle_container">
        <div id="icon_container"></div>
        <div id="login_containers">
            <div id="insert_email">
                <input id="email_input" 
                 type="email" 
                 placeholder="E-mail" 
                 required
                 value={email}
                 onChange={handleEmailChange}></input>
            </div>
            <div id="insert_password">
                <input id="password_input" type="password" placeholder="Password"required value={password}
              onChange={handlePasswordChange}>

                </input>
            </div>
            <div id="login_button" onClick={checkCredentials}>
                    <p>log in</p>
            </div>
        </div>
    </div>
    <script src=""></script>
</body>
    </div>
  );
}

export default App;
